import { createBrowserRouter } from "react-router-dom";
import Home from "./pages/Home"
import Products from "./pages/Products";


createBrowserRouter([
  { path: '/', element: <Home /> },
  { path: '/products', element: <Products /> }
])

function App() {
  return <div>Hello</div>;
}

export default App;
